include("apis/api_StocksApi.jl")
include("apis/api_TariffsApi.jl")
include("apis/api_WarehousesApi.jl")

"""
Register handlers for all APIs in this module in the supplied `Router` instance.

Paramerets:
- `router`: Router to register handlers in
- `impl`: module that implements the server methods

Optional parameters:
- `path_prefix`: prefix to be applied to all paths
- `optional_middlewares`: Register one or more optional middlewares to be applied to all requests.

Optional middlewares can be one or more of:
    - `init`: called before the request is processed
    - `pre_validation`: called after the request is parsed but before validation
    - `pre_invoke`: called after validation but before the handler is invoked
    - `post_invoke`: called after the handler is invoked but before the response is sent

The order in which middlewares are invoked are:
`init |> read |> pre_validation |> validate |> pre_invoke |> invoke |> post_invoke`
"""
function register(router::HTTP.Router, impl; path_prefix::String="", optional_middlewares...)
    registerBidsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerBusinessOfferMappingsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerBusinessesApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerCampaignsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerCategoriesApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerChatsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerContentApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerDbsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerDeliveryServicesApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerExpressApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerFbsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerFbyApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerFeedbacksApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerFeedsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerGoodsFeedbackApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerGoodsStatsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerHiddenOffersApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerModelsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerOfferMappingsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerOffersApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerOrderBusinessInformationApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerOrderDeliveryApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerOrderLabelsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerOrdersApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerOrdersStatsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerOutletLicensesApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerOutletsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerPriceQuarantineApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerPricesApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerPromosApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerRatingsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerRegionsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerReportsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerReturnsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerShipmentsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerStocksApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerTariffsApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    registerWarehousesApi(router, impl; path_prefix=path_prefix, optional_middlewares...)
    return router
end

end # module ympa_julia_server
